import React from 'react'
const G_LOGO = '../../../assets/googleIcon.svg';

const GAuth = () => {
  return (
    <div>
        <img style={{width:50,height:50}}src={G_LOGO} alt="googleLogo" />
    </div>
  )
}

export default GAuth
